import React from 'react'
import i18n from "i18next";
import { useTranslation } from "react-i18next";

import I18n from '../I18n';

function Home() {

  const { t } = useTranslation();


  return (
    <div className="App">
    <div className="App-header">
      <h1>Hola soy {t('homePage.title')}</h1>
      <I18n t="home" />

    </div>
  </div>
  )
}

export default Home
